import React from "react";

const TickIcon = () => {
    return (

      <svg 
        className="tick" 
        xmlns="http://www.w3.org/2000/svg" 
        width="30" 
        height="30" 
        viewBox="0 0 512 512" 
        id="IconChangeColor">
          <title>
            ionicons-v5-e
          </title>
          <path d="M448,256c0-106-86-192-192-192S64,150,64,256s86,192,192,192S448,362,448,256Z" id="mainIconPathAttribute"></path>
          <polyline 
          points="352 176 217.6 336 160 272" 
          >

          </polyline>
      </svg>

    );
  }
  
  export default TickIcon;
